import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';
import Login from './Components/Login'

class App extends Component {

  state = {
    currentUser: {}
  }

  render() {
    return (
      <div className="App">
        <Route exact path="/login" component={Login}/>
      </div>

    );
  }
}

export default App;
